import React, { Component } from 'react';
import './App.css';
import {inject, observer} from 'mobx-react';
import Todo from "./component/todo.js";
import Add from "./component/add";

@inject('myHouseApp')
@observer

class App extends Component {

  constructor(props) {
    super(props);
    props.myHouseApp.listHouses();
  }

  render() {
    const {myHouseApp} = this.props;

    const elements = myHouseApp.output.houses.map((item, key)=> 
      <Todo key={key} index={key} item={JSON.stringify(item)} />
    )

    return (

      <div className="App">
        <h1>My House List</h1>

        <div className="tabs">
          <div className="getFrame frame">
            <h2>Get</h2>
            <div className="get page">
              <ul>
                {elements}
              </ul>
            </div>
          </div>

          <div className="postFrame frame">
            <h2>Post</h2>
            <div className="post page">
              <Add
                addNewTodo = {myHouseApp.addNewTodo}
              />
            </div>
          </div>
        </div>  
      </div>
    );
  }
}

export default App;
